	"@@Arithmetic_Operation_tag4@@": "<strong>ลบ</strong>--เอาท์พุทผลต่างระหว่างค่าพิกเซลที่สอดคล้องกันของแต่ละแรสเตอร์ สามารถใช้การดำเนินการนี้เพื่อคำนวณการตรวจจับการเปลี่ยนแปลงได้",
