	"@@Composite-Bands_cellsizetype_tag0@@": "<p>เลือกขนดาเซลล์ที่จะใช้ในราสเตอร์เอาท์พุท หากขนาดเซลล์อินพุททั้งหมดเหมือนกัน ตัวเลือกทั้งหมดจะให้ผลลัพธ์เดียวกัน</p><ul><li>แรกสุดของ--ใช้ขนาดเซลล์แรกสุดของราสเตอร์อินพุท</li><li>ต่ำสุดของ--ใช้ขนาดเซลล์ที่เล็กที่สุดของราสเตอร์อินพุททั้งหมด</li><li>สูงสุดของ--ใช้ขนาดเซลล์ที่ใหญ่ที่สุดของราสเตอร์อินพุท นี่คือค่าเริ่มต้น</li><li>ค่าเฉลี่ยของ--ใช้ขนาดเซลล์เฉลี่ยของอินพุทแรสเตอร์ทั้งหมด</li><li>สุดท้ายของ--ใช้ขนาดเซลล์สุดท้ายของอินพุทแรสเตอร์</li></ul>",
