	"@@Focal-Statistics_Neighborhood_tag7@@": "น้ำหนัก, ความกว้าง, ความสูง, ค่าใกล้เคียง",
	"@@Focal-Statistics_Neighborhood_tag8@@": "พื้นที่ใกล้เคียงแบบไม่ปกติ จะช่วยให้คุณสามารถระบุพื้นที่ใกล้เคียงรูปทรงไม่ปกติรอบๆ การประมวลผลเซลล์ได้ ใช้ตารางค่าพื้นที่ใกล้เคียง เพื่อกำหนดรูปทรงของ kernel พื้นที่ใกล้เคียง ค่า 0 สำหรับตำแหน่งเซลล์ จะระบุว่าเซลล์ดังกล่าวไม่ได้เป็นส่วนหนึ่งของพื้นที่ใกล้เคียง และจะไม่ถูกนำมาใช้ในการประมวลผล ค่า 1 จะระบุว่าเซลล์ที่สอดคล้องกัน (และค่า) เป็นสมาชิกของพื้นที่ใกล้เคียง",
	"@@Focal-Statistics_Neighborhood_tag9@@": "พื้นที่ใกล้เคียงถ่วงน้ำหนัก จะคล้ายกับประเภทพื้นที่ใกล้เคียงที่ไม่ปกติ ซึ่งช่วยให้คุณสามารถกำหนดพื้นที่ใกล้เคียงที่ไม่ปกติไว้รอบๆ การประมวลผลเซลล์ได้ แต่จะช่วยให้คุณสามารถเพิ่มน้ำหนักให้กับค่าอินพุทได้เพิ่มเติม ค่าใน kernal น้ำหนักจะระบุว่าควรรวมตำแหน่งเซลล์ใดไว้ภายในพื้นที่ใกล้เคียง รวมถึงน้ำหนักที่จะทำการคูณ ใช้ค่า 0 เพื่อตัดเซลล์นี้ออกจากการประมวลผล ค่าบวก ค่าลบ และทศนิยม คือตัวเลือกที่ใช้ได้ในการใช้งานเป็นน้ำหนัก สำหรับประเภทพื้นที่ใกล้เคียงถ่วงน้ำหนัก จะรองรับเฉพาะสถิติค่าเฉลี่ย ค่าเบี่ยงเบนมาตรฐาน หรือผลรวมเท่านั้น",
