	"@@Focal-Statistics_Statistics-Type_tag17@@": "<strong>พิสัย</strong>--คำนวณพิสัย (ส่วนต่างระหว่างค่าที่มากที่สุดและน้อยที่สุดฉ ของเซลล์ในพื้นที่ใกล้เคียง",
