	"@@Focal-Statistics_Statistics-Type_tag25@@": "หากอินพุทแรสเตอร์เป็นจุดลอยตัว จะใช้ได้เฉพาะสถิติประเภทค่าเฉลี่ย สูงสุด มัธยฐาน ขั้นต่ำ เปอร์เซนไทล์ ช่วง ค่าเบี่ยงเบนมาตรฐาน และผลรวมเท่านั้น",
