	"@@Geometric_Constant-Z_tag0@@": "ระบุระดับความสูงคงที่เพื่อใช้ในฟังก์ชันเรขาคณิต",
	"@@Geometric_DEM_tag0@@": "ระบุ DEM ที่จะใช้งานสำหรับฟังก์ชันเรขาคณิต คุณสามารถใช้ DEM ที่มีอยู่ในชุดข้อมูลโมเสกในรูปแบบชุดข้อมูลแรสเตอร์ หรือในรูปแบบชุดข้อมูลโมเสกที่เอาท์พุทเป็น DEM ได้",
	"@@Geometric_Geoid_tag0@@": "ชุดข้อมูลระดับความสูงส่วนใหญ่ เช่น USGS NED หรือ ArcGIS Online World Elevation จะเป็นความสูงแบบออร์โทเมตริก จึงจำเป็นต้องเลือกการแก้ไข Geoid เพื่อให้สามารถใช้งานร่วมกับ RPC ดาวเทียม ที่จำเป็นต้องใช้ความสูงทรงรีได้ ทำเครื่องหมายในช่อง <strong>Geoid</strong> เพื่อใช้งานการแก้ไข geoid (EGM96) กับค่า z ยกเว้นกรณีที่ DEM ของคุณมีการอ้างอิงไปยังความสูงทรงรีอยู่แล้ว",
	"@@Geometric_Method_tag0@@": "เลือกวิธีการระดับความสูงสำหรับฟังก์ชันเรขาคณิต:",
	"@@Geometric_Method_tag1@@": "ใช้ค่าคงที่ Z--ระบุระดับความสูงคงที่เพื่อดำเนินการฟังก์ชันเรขาคณิต",
	"@@Geometric_Method_tag2@@": "ใช้ DEM--ระบุ DEM เพื่อดำเนินการฟังก์ชันเรขาคณิต",
	"@@Geometric_Raster_tag0@@": "อินพุทแรสเตอร์",
	"@@Geometric_Z-Factor_tag0@@": "สัมประสิทธิ์พหุนามตรรกยะ (RPC) ดาวเทียม จะถูกปรับสเกลสำหรับชุดข้อมูลระดับความสูง โดยมีหน่วยแนวตั้งเป็นเมตร หากระดับความสูงของคุณใช้หน่วยแนวตั้งอื่นๆ ให้ป้อน <strong>Z แฟกเตอร์</strong> เพื่อปรับสเกลเป็นเมตร เช่น หากหน่วยระดับความสูงของคุณเป็นฟุต คุณจะใช้ค่า 0.3048 ในการแปลงหน่วยระดับความสูงของคุณจากฟุตเป็นเมตร",
	"@@Geometric_Z-Offset_tag0@@": "ค่าฐานที่จะเพิ่มลงในค่าระดับความสูงใน DEM ซึ่งอาจสามารถใช้เป็นค่าระดับความสูงออฟเซ็ต ที่ไม่ได้เริ่มต้นที่ระดับน้ำทะเลได้",
	"@@Geometric_Tolerance_tag0@@": "ระบุข้อผิดพลาดที่ยอมรับสูงสุดในฟังก์ชันเรขาคณิต โดยกำหนดจำนวนพิกเซล ค่าเริ่มต้นของประเภทแรสเตอร์ NITF (NCDRD) ได้แก่สอง",
	"@@Grayscale_Raster_tag0@@": "อินพุทแรสเตอร์",
	"@@Grayscale_Conversion-Parameters_tag0@@": "น้ำหนักของแต่ละแบนด์ที่ประกอบด้วยอินพุทแรสเตอร์",
	"@@Greater-Than_Cellsize-Type_tag0@@": "เลือกขนาดเซลล์ที่จะใช้เป็นเอาท์พุทแรสเตอร์ หากขนาดเซลล์อินพุททั้งหมดเท่ากัน ตัวเลือกทั้งหมดจะให้ผลลัพธ์เดียวกัน",
	"@@Greater-Than_Cellsize-Type_tag1@@": "แรกของ--ใช้ขนาดเซลล์แรกของอินพุทแรสเตอร์",
	"@@Greater-Than_Cellsize-Type_tag2@@": "สุดท้ายของ--ใช้ขนาดเซลล์สุดท้ายของอินพุทแรสเตอร์",
