	"@@Pansharpening_Pansharpening-Type_tag2@@": "Esri--ใช้อัลกอริธึม Esri โดยอิงตามการสร้างโมเดลสเปกตรัลสำหรับการฟิวชันข้อมูล",
	"@@Pansharpening_Pansharpening-Type_tag3@@": "Gram-Schmidt--ใช้อัลกอริธึมการเพิ่มความคมชัดสเปกตรัล Gram-Schmidt เพื่อเพิ่มความคมชัดข้อมูลแบบมัลติสเปกตรัล",
