	"@@Resample_Resampling-Type_tag6@@": "<strong>ส่วนใหญ่</strong>--คำนวณค่าพิกเซลโดยใช้ค่าพิกเซลหลักใน 16 พิกเซลที่ใกล้ที่สุด พิกเซล NoData จะไม่ถูกเปลี่ยนแปลงในเอาท์พุทชุดข้อมูลแรสเตอร์",
	"@@Resample_Resampling-Type_tag8@@": "<strong>การหาความสัมพันธ์เชิงเส้นคู่แบบพลัส</strong>--จะใช้ <strong>การหาความสัมพันธ์เชิงเส้นคู่</strong> ยกเว้นพิกเซลตามแนวขอบ จะถูกกำหนดค่าเป็น NoData และจะไม่สามารถทำซ้ำหรือพิจารณาในการคำนวณได้ ใช้ <strong>การหาความสัมพันธ์เชิงเส้นคู่แบบพลัส</strong> สำหรับข้อมูลแบบไทล์ เนื่องจากขอบจะตรงกันมากขึ้น",
	"@@Resample_Resampling-Type_tag14@@": "<strong>เกาส์เบลอ</strong>--ใช้เกาส์เชียนคอนโวลูชันกับแรสเตอร์ต้นทาง และคำนวณค่าพิกเซลโดยใช้ค่าถ่วงน้ำหนักระยะทางของสี่พิกเซลที่ใกล้ที่สุดจากแรสเตอร์ที่เบลอ เหมาะสำหรับการลบนอยส์ในข้อมูลที่รีแซมเปิลออก และการดาวน์แซมปลิงเป็นขนาดพิกเซลที่ใหญ่ขึ้น",
	"@@Resample_Resampling-Type_tag16@@": "<strong>เกาส์เบลอพลัส</strong>--จะใช้วิธีการเดียวกับ <strong>เกาส์เบลอ</strong> ยกเว้นพิกเซลตามแนวขอบ จะถูกกำหนดค่าเป็น NoData และจะไม่สามารถทำซ้ำหรือพิจารณาในการคำนวณได้ ใช้ <strong>เกาส์เบลอพลัส</strong> สำหรับข้อมูลแบบไทล์ เนื่องจากขอบจะตรงกันมากขึ้น",
