	"@@Segment-Mean-Shift_Spatial-Detail_tag1@@": "ค่าจำนวนเต็มที่ใช้ได้ จะอยู่ในช่วง 1 ถึง 20 ค่าที่น้อยลงจะส่งผลให้คลาสกว้างขึ้นและปรับสมูธมากขึ้น ค่าที่สูงขึ้น จะเหมาะสำหรับการแยกความแตกต่างระหว่างฟีเจอร์ที่เล็กว่าในเชิงพื้นที่ และจับกลุ่มอยู่ด้วยกัน เช่น ในซีนเขตเมือง คุณจะสามารถแยกพื้นผิวบริเวณทั่วไปที่เข้าไม่ได้ได้ โดยใช้ค่ารายละเอียดเชิงพื้นที่ที่น้อยลง หรือแยกระหว่างอาคารและถนนในรูปแบบคลาสที่แยกจากกัน โดยใช้ค่ารายละเอียดเชิงพื้นที่ที่สูงขึ้น",
