	"@@Shaded-Relief_Azimuth_tag0@@": "อะซิมุทคือตำแหน่งสัมพัทธ์ของดวงอาทิตย์ตามแนวขอบฟ้า (หน่วยองศา) ตำแหน่งนี้จะถูกระบุตามมุมของดวงอาทิตย์ที่วัดตามเข็มนาฬิกา โดยเริ่มต้นขณะหันหน้าไปทางทิศเหนือ มุมอะซิมุท 0 องศาคือทิศเหนือ 90 องศาคือทิศตะวันออก 180 องศาคือทิศใต้ และ 270 องศาคือทิศตะวันตก",
