	"@@Shaded-Relief_Disable-default-edge-pixel-interpolation_tag3@@": "การใช้ตัวเลือกนี้ จะหลีกเลี่ยงการรีแซมเปิลอาร์ทิแฟ็คท์ที่อาจเกิดขึ้นตามแนวขอบของแรสเตอร์ได้ เอาท์พุทพิกเซลตามแนวขอบของแรสเตอร์ หรือที่ติดกับพิกเซลที่ไม่มีค่า จะถูกเติมด้วย NoData ดังนั้น ขอแนะนำให้ใช้ตัวเลือกนี้เฉพาะเมื่อมีแรสเตอร์อื่นที่มีพิกเซลทับซ้อนกันอยู่ เมื่อมีพิกเซลทับซ้อนกันอยู่ พื้นที่ NoData เหล่านี้จะแสดงผลค่าพิกเซลทับซ้อนแทนการเว้นว่าง",
