	"@@Shaded-Relief_Scaling_tag0@@": "ผลลัพธ์ที่แรเงา จะถูกปรับสเกลแบบไดนามิกโดยการปรับตั้งปัจจัย z ด้วยหนึ่งในสองตัวเลือก:",
	"@@Shaded-Relief_Scaling_tag1@@": "<strong>ไม่มี</strong>--ไม่ใช้งานการปรับสเกล เหมาะสำหรับชุดข้อมูลแรสเตอร์เดี่ยวที่ครอบคลุมพื้นที่ท้องถิ่น ไม่แนะนำให้ใช้กับชุดข้อมูลทั่วโลกที่มีระดับความสูงหลากหลาย หรือแผนที่หลายสเกล เนื่องจากจะเป็นการสร้างความนูนภูมิประเทศที่แตกต่างกันเพียงเล็กน้อยที่สเกลเล็กๆ",
