	"@@Slope_Scaling_tag7@@": "<strong>ปรับสเกล</strong>--คำนวณความลาดเอียงของความชันในรูปแบบเดียวกับ DEGREE แต่จะปรับค่าปัจจัย z สำหรับสเกล หากใช้ค่า <strong>ยกกำลังขนาดพิกเซล</strong> และ <strong>แฟกเตอร์ขนาดเป็นพิกเซล</strong> ซึ่งจะช่วยรองรับการเปลี่ยนแปลงความละเอียด (สเกล) ในขณะที่ผู้ดูซูมเข้าและออก ขอแนะนำให้ใช้ค่านี้ขณะใช้ชุดข้อมูลทั่วโลก--โดยเฉพาะอย่างยิ่งในขณะที่ใช้ความลาดชันในรูปแบบพื้นผิวเพื่อการแสดงภาพ",
