	"@@Stream-Order_Order-Method_tag0@@": "วิธีการที่ใช้ในการกำหนดลำดับสตรีม",
	"@@Stream-Order_Order-Method_tag1@@": "<strong>STRAHLER</strong>--วิธีการกำหนดลำดับสตรีมนั้นถูกเสนอโดย Strahler ในปี 1952 ลำดับสตรีมจะเพิ่มขึ้นเมื่อสตรีมในลำดับเดียวกันตัดกัน การตัดกันของลิงก์ลำดับแรกกับลำดับที่สอง จะคงลิงก์ลำดับที่สองไว้ แทนการสร้างลิงก์ลำดับที่สาม นี้คือค่าตั้งต้น",
	"@@Stream-Order_Order-Method_tag3@@": "<strong>SHREVE</strong>--วิธีการกำหนดลำดับสตรีมตามขนาดนั้น ถูกเสนอโดย Shreve ในปี 1967 ลิงก์ทั้งหมดที่ไม่มีสายย่อย จะได้รับการกำหนดขนาด (ลำดับ) เป็นหนึ่ง ขนาดจะเป็นความชันลาดลงแบบบวก เมื่อสองลิงก์ตัดกัน ขนาดของทั้งคู่จะถูกเพิ่มและกำหนดไปยังลิงก์ความชันลาดลง",
	"@@Stream-Order_Stream-Raster_tag0@@": "อินพุทแรสเตอร์สตรีมที่จะแสดงเครือข่ายสตรีมแบบเชิงเส้น",
	"@@Stretch_Auto-Gamma_tag0@@": "ใช้ <strong>ออโต้แกมมา</strong> เพื่อคำนวณแกมมาจากสถิติและฮิสโตแกรมของชุดข้อมูล สามารถประมาณการสถิติได้ด้วยตัวฟังก์ชันเอง หรือให้ซอฟต์แวร์ประมาณการสถิติ ในกรณีที่คุณเลือกชั้นข้อมูล",
	"@@Stretch_Dynamic-Range-Adjustment_tag0@@": "ทำเครื่องหมายในช่อง <strong>การปรับพิสัยไดนามิก</strong> หากคุณต้องการคำนวณสถิติจากพิกเซลที่แสดงผลบนหน้าจอของคุณเท่านั้น โดยทั่วไปจะใช้ตัวเลือกนี้เมื่อจะนำภาพไปเผยแพร่และใช้งานในเว็บแอพที่ไม่สามารถดำเนินการยืดประเภทนี้ได้",
	"@@Stretch_Estimate-Statistics_tag0@@": "ทำเครื่องหมายในช่อง <strong>สถิติโดยประมาณ</strong> หากคุณต้องการประเมินสถิติของคุณ สถิติที่ประมาณการจะถูกคำนวณจากการแซมปลิง 1000 คูณ 1000 จากศูนย์กลางของแรสเตอร์ และใช้งานโดยการยืด",
	"@@Stretch_Estimate-Statistics_tag3@@": "หากเลือกไว้ และแรสเตอร์มีสถิติอยู่ หรือคุณทำการป้อนค่าลงในตาราง <strong>สถิติ</strong> จะถูกนำไปใช้แทนการประมาณการ ยกเว้นกรณีที่การยืดจำเป็นต้องใช้ฮิสโตแกรม หากการยืดจำเป็นต้องใช้ฮิสโตแกรมที่ไม่มีอยู่ ก็จะทำการประมาณการ",
