	"@@Swath_Interpolation-Method_tag7@@": "<strong>พื้นที่ใกล้เคียงธรรมชาติ</strong>--ดำเนินการกำหนดพื้นที่ใกล้เคียงที่ใกล้ที่สุด เป็นวิธีการแทรกที่รวดเร็วที่สุด จะใช้กับข้อมูลแบบไม่ต่อเนื่องเป็นหลัก เช่น การจัดคลาสการใช้งานที่ดิน เนื่องจากจะไม่เปลี่ยนแปลงค่าของเซลล์ ข้อผิดพลาดเชิงพื้นที่สูงสุด จะอยู่ที่ขนาดเซลล์หารสอง",
