	"@@Viewshed_Horizontal-End-Angle_tag0@@": "ค่านี้จะกำหนดมุมสิ้นสุดของช่วงการสแกนแนวนอน ควรระบุค่าเป็นองศาจาก 0 ถึง 360.0 โดยที่ 0 จะหันไปทางทิศเหนือ ค่าเริ่มต้นคือ 360.0",
	"@@Viewshed_Horizontal-End-Angle_tag1@@": "สามารถเป็นฟิลด์ในชุดข้อมูลอินพุท <strong>ฟีเจอร์ของตัวสังเกตการณ์</strong> หรือค่าตัวเลข หากตั้งค่าพารามิเตอร์นี้ไว้ ค่าดังกล่าวจะถูกใช้กับตัวสังเกตการณ์ทั้งหมด หากต้องการระบุค่าที่แตกต่างกันระหว่างแต่ละตัวสังเกตการณ์ ให้ตั้งค่าพารามิเตอร์นี้เป็นฟิลด์ใน <strong>ฟีเจอร์ของตัวสังเกตการณ์</strong>",
