	"@@Multidimensional-Raster_interpolationmethod_tag0@@": "วิธีการรีแซมปลิงที่ใช้ในการแทรกข้อมูลไม่ปกติ",
	"@@Multidimensional-Raster_interpolationmethod_tag1@@": "<strong>พื้นที่ใกล้เคียงที่ใกล้ที่สุด</strong>--คำนวณค่าพิกเซลเอาท์พุทโดยใช้พิกเซลอินพุทที่ใกล้ที่สุด หากไม่มีพิกเซลต้นทางอยู่ จะไม่สามารถสร้างพิกเซลใหม่ในเอาท์พุทได้ นี้คือค่าตั้งต้น",
	"@@Multidimensional-Raster_interpolationmethod_tag2@@": "<strong>ทินนิงเชิงเส้น</strong>--ใช้เครือข่ายไม่ปกติสามเหลี่ยมจากจุดศูนย์กลางของแต่ละพิกเซลในแรสเตอร์ไม่ปกติ เพื่อแทรกพื้นผิวที่จะถูกแปลงเป็นแรสเตอร์ปกติหลังจากนั้น",
	"@@Multidimensional-Raster_interpolationmethod_tag3@@": "<strong>พื้นที่ใกล้เคียงธรรมชาติ</strong>--ค้นหาซับเซ็ตที่ใกล้ที่สุดของอินพุทแซมเปิลถึงจุดคิวรี และเพิ่มน้ำหนักลงไปโดยอิงตามพื้นที่ตามสัดส่วนเพื่อแทรกค่า",
	"@@Multidimensional-Raster_interpolationmethod_tag4@@": "<strong>การถ่วงน้ำหนักระยะทางแบบย้อนกลับ</strong>--หาค่าพิกเซลโดยการรรวมชุดจุดแซมเปิลหรือพิกเซลแบบถ่วงน้ำหนักเชิงเส้น น้ำหนักเป็นฟังก์ชันของอินเวิร์สของระยะทางจากจุดหรือพิกเซลที่ทราบอยู่แล้ว",
	"@@Multidimensional-Raster_raster_tag0@@": "อินพุตแรสเตอร์หลายมิติ",
	"@@Multidimensional-Raster_variables_tag0@@": "ตัวแปรที่จะรวมอยู่ในชั้นข้อมูลแรสเตอร์หลายมิติ",
	"@@Random_distribution_tag0@@": "ระบุวิธีการกระจายค่าแบบสุ่มที่จะใช้",
	"@@Random_distribution_tag1@@": "<strong>ยูนิฟอร์ม</strong> (ต่ำสุด, สูงสุด)--กระจายแบบยูนิฟอร์มด้วยพิสัยที่กำหนด ค่าเริ่มต้นคือ 0 สำหรับค่าต่ำสุด และ 1 สำหรับค่าสูงสุด นี้คือค่าตั้งต้น",
	"@@Random_distribution_tag2@@": "<strong>จำนวนเต็ม</strong> (ต่ำสุด, สูงสุด)--การกระจายแบบจำนวนเต็มด้วยพิสัยที่กำหนด ค่าเริ่มต้นคือ 1 สำหรับค่าต่ำสุด และ 10 สำหรับค่าสูงสุด",
	"@@Random_distribution_tag3@@": "<strong>ปกติ</strong> (ค่าเฉลี่ย, ค่าเบี่ยงเบนมาตรฐาน)--การกระจายแบบปกติ ด้วยค่าเฉลี่ยและค่าเบี่ยงเบนมาตรฐานที่กำหนด ค่าเริ่มต้นคือ 0 สำหรับค่าเฉลี่ย และ 1 สำหรับค่าเบี่ยงเบนมาตรฐาน",
	"@@Random_distribution_tag4@@": "<strong>เอ็กซ์โพเนนเชียล</strong> (Mean)--การกระจายแบบเอ็กซ์โพเนนเชียล ด้วยค่าเฉลี่ยที่กำหนด ค่าเริ่มต้นคือ 1",
	"@@Random_distribution_tag5@@": "<strong>ปัวซอง</strong> (Mean)-การกระจายแบบปัวซอง ด้วยค่าเฉลี่ยที่กำหนด ค่าเริ่มต้นคือ 1",
	"@@Random_distribution_tag6@@": "<strong>แกมมา</strong> (อัลฟา, เบต้า)--การกระจายแบบแกมมาด้วยอัลฟาและเบต้าที่กำหนด ค่าเริ่มต้นคือ 1 สำหรับอัลฟา และ 1 สำหรับเบต้า",
	"@@Random_distribution_tag7@@": "<strong>ไบโนเมียล</strong> (N, ความน่าจะเป็น)--การกระจายแบบไบโนเมียล ด้วยค่า N และความน่าจะเป็นที่กำหนด ค่าเริ่มต้นคือ 10 สำหรับ N  และ 0.5 สำหรับความน่าจะเป็น",
	"@@Random_distribution_tag8@@": "<strong>เรขาคณิต</strong> (ความน่าจะเป็น)--การกระจายแบบเรขาคณิต ด้วยความน่าจะเป็นที่กำหนด ค่าเริ่มต้นคือ 0.5",
	"@@Random_distribution_tag9@@": "<strong>เนกาทีฟไบโนเมียล</strong> (r, Probability)--การกระจายแบบปาสคาล ด้วยค่า r และความน่าจะเป็นที่กำหนด ค่าเริ่มต้นคือ 10.0 สำหรับ r และ 0.5 สำหรับความน่าจะเป็น",
	"@@Random_randomnumbergenerator_tag0@@": "ระบุอัลกอริธึมตัวสร้างค่าสุ่มที่ใช้ซีดและการกระจายในการสร้างลำดับของเลขสุ่ม ตัวเลือกที่ใช้ได้จะมีดังนี้:",
	"@@Random_randomnumbergenerator_tag1@@": "ซีแรนด์มาตรฐาน",
