	"@@Distance-Accumulation_maximumaccumulation_tag0@@": "กำหนดต้นทุนสะสมสูงสุดสำหรับนักเดินทางในส่วนของต้นทาว การคำนวณต้นทุนจะดำเนินต่อไปสำหรับแต่ละต้นทาง จนกว่าจะเพิ่มถึงความจุที่กำหนด",
	"@@Distance-Accumulation_maximumaccumulation_tag1@@": "สามารถใช้ค่าตัวเลข (ดับเบิล) หรือฟิลด์จาก <strong>แรสเตอร์ต้นทาง</strong> สำหรับพารามิเตอร์นี้ได้",
	"@@Distance-Accumulation_maximumaccumulation_tag2@@": "ค่าต้องมากกว่าศูนย์ ความจุเริ่มต้นจะอยู่ที่ขอบของเอาท์พุทแรสเตอร์",
