	"@@Distance-Allocation_sourcerowandcolumnbands_tag1@@": "ไม่เลือก--ผลลัพธ์ที่ได้คือแรสเตอร์จัดสรรระยะทาง นี่คือผลลัพธ์แบบแบนด์เดียว นี่คือค่าเริ่มต้น",
